The way that data is stored and represented is an integral part of every data storage system. Whether it is a SQL or NoSQL database, a columner store, a KV store, or anything which stores data, control over the storage technology and technique is critical. This implementation of Raft uses the RaftStorage trait to define the behavior needed of an application's storage layer to work with Raft. This is definitely the most complex looking trait in this crate. Ultimately the implementing type must be an Actix Actor and it must implement handlers for a specific set of message types. When creatinga new RaftStorage instance, it would be logical to supply the ID of the parent Raft node as well as the node's snapshot directory. Such information is needed when booting a node for the first time. pub trait RaftStorage<D, R, E>: 'static where D: AppData, R: AppDataResponse, E: AppError,
{ /// The type to use as the storage actor. Should just be Self. type Actor: Actor<Context=Self::Context> + Handler<GetInitialState<E>> + Handler<SaveHardState<E>> + Handler<GetLogEntries<D, E>> + Handler<AppendEntryToLog<D, E>> + Handler<ReplicateToLog<D, E>> + Handler<ApplyEntryToStateMachine<D, R, E>> + Handler<ReplicateToStateMachine<D, E>> + Handler<CreateSnapshot<E>> + Handler<InstallSnapshot<E>> + Handler<GetCurrentSnapshot<E>>; /// The type to use as the storage actor's context. Should be `Context<Self>` or `SyncContext<Self>`. type Context: ActorContext + ToEnvelope<Self::Actor, GetInitialState<E>> + ToEnvelope<Self::Actor, SaveHardState<E>> + ToEnvelope<Self::Actor, GetLogEntries<D, E>> + ToEnvelope<Self::Actor, AppendEntryToLog<D, E>> + ToEnvelope<Self::Actor, ReplicateToLog<D, E>> + ToEnvelope<Self::Actor, ApplyEntryToStateMachine<D, R, E>> + ToEnvelope<Self::Actor, ReplicateToStateMachine<D, E>> + ToEnvelope<Self::Actor, CreateSnapshot<E>> + ToEnvelope<Self::Actor, InstallSnapshot<E>> + ToEnvelope<Self::Actor, GetCurrentSnapshot<E>>;
} Actix handlers must be implemented for the following types, all of which are found in the storage module: GetInitialState : A request from Raft to get Raft's state information from storage. SaveHardState : A request from Raft to save its HardState. GetLogEntries : A request from Raft to get a series of log entries from storage. AppendEntryToLog : A request from Raft to append a new entry to the log. ReplicateToLog : A request from Raft to replicate a payload of entries to the log. ApplyEntryToStateMachine : A request from Raft to apply the given log entry to the state machine. ReplicateToStateMachine : A request from Raft to apply the given log entries to the state machine, as part of replication. CreateSnapshot : A request from Raft to have a new snapshot created which covers the current breadth of the log. InstallSnapshot : A request from Raft to have a new snapshot written to disk and installed. GetCurrentSnapshot : A request from Raft to get metadata of the current snapshot. The following sections detail how to implement a safe and correct storage system for Raft using the RaftStorage trait. A very important note to keep in mind: data storage, data layout, data representation ... all of that is up to the implementor of the RaftStorage trait. That's the whole point. Every application is going to have nuances in terms of what they need to do at the storage layer. This is one of the primary locations where an application can innovate and differentiate.

