To get started, applications can define a type alias which declares the types which are going to be used for the application's data, errors, RaftNetwork impl & RaftStorage impl. First, let's define the new application's main data type & a response type. This is the data which will be inside of Raft's normal log entries and the response type which the storage engine will return after applying them to the state machine. use actix_raft::{AppData, AppDataResponse};
use serde::{Serialize, Deserialize}; /// The application's data type.
///
/// Enum types are recommended as typically there will be different types of data mutating
/// requests which will be submitted by application clients.
#[derive(Clone, Debug, Serialize, Deserialize)]
enum Data { // Your data variants go here.
} /// The application's data response types.
///
/// Enum types are recommended as typically there will be multiple response types which can be
/// returned from the storage layer.
#[derive(Clone, Debug, Serialize, Deserialize)]
enum DataResponse { // Your response variants go here.
} /// This also has a `'static` lifetime constraint, so no `&` references at this time.
/// The new futures & async/await should help out with this quite a lot, so
/// hopefully this constraint will be removed in actix as well.
impl AppData for Data {} /// This also has a `'static` lifetime constraint, so no `&` references at this time.
impl AppDataResponse for DataResponse {} Now we'll define the application's error type. use actix_raft::AppError;
use serde::{Serialize, Deserialize}; /// The application's error struct. This could be an enum as well.
///
/// NOTE: the below impls for Display & Error can be
/// derived using crates like `Failure` &c.
#[derive(Debug, Serialize, Deserialize)]
pub struct Error; impl std::fmt::Display for Error { fn fmt(&self, f: &mut std::fmt::Formatter<'_>) -> std::fmt::Result { // ... snip ... }
} impl std::error::Error for Error {} // Mark this type for use as an `actix_raft::AppError`.
impl AppError for Error {} Now for the two big parts. RaftNetwork & RaftStorage. Here, we will only look at the skeleton for these types. See the network & storage chapters for more details on how to actually implement these types. First, let's cover the network impl. use actix::{Actor, Context, ResponseActFuture};
use actix_raft::{RaftNetwork, messages}; /// Your application's network interface actor.
struct AppNetwork {/* ... snip ... */} impl Actor for AppNetwork { type Context = Context<Self>; // ... snip ... other actix methods can be implemented here as needed.
} // Ensure you impl this over your application's data type. Here, it is `Data`.
impl RaftNetwork<Data> for AppNetwork {} // Then you just implement the various message handlers.
// See the network chapter for details.
impl Handler<messages::AppendEntriesRequest<Data>> for AppNetwork { type Result = ResponseActFuture<Self, messages::AppendEntriesResponse, ()>; fn handle(&mut self, _msg: messages::AppendEntriesRequest<Data>, _ctx: &mut Self::Context) -> Self::Result { // ... snip ... # actix::fut::err(()) }
} // Impl handlers on `AppNetwork` for the other `actix_raft::messages` message types. Now for the storage impl. We'll use an actix::Context here (which is async), but you could also use an actix::SyncContext. use actix::{Actor, Context, ResponseActFuture};
use actix_raft::{NodeId, RaftStorage, storage}; /// Your application's storage interface actor.
struct AppStorage {/* ... snip ... */} // Ensure you impl this over your application's data, data response & error types.
impl RaftStorage<Data, DataResponse, Error> for AppStorage { type Actor = Self; type Context = Context<Self>;
} impl Actor for AppStorage { type Context = Context<Self>; // ... snip ... other actix methods can be implemented here as needed.
} // Then you just implement the various message handlers.
// See the storage chapter for details.
impl Handler<storage::GetInitialState<Error>> for AppStorage { type Result = ResponseActFuture<Self, storage::InitialState, Error>; fn handle(&mut self, _msg: storage::GetInitialState<Error>, _ctx: &mut Self::Context) -> Self::Result { // ... snip ... # actix::fut::err(()) }
} // Impl handlers on `AppStorage` for the other `actix_raft::storage` message types. In order for Raft to expose metrics on how it is doing, we will need a type which can receive RaftMetrics messages. Application's can do whatever they want with this info. Expose integrations with Prometheus & Influx, trigger events, whatever is needed. Here we will keep it simple. use actix::{Actor, Context};
use actix_raft::RaftMetrics; /// Your application's metrics interface actor.
struct AppMetrics {/* ... snip ... */} impl Actor for AppMetrics { type Context = Context<Self>; // ... snip ... other actix methods can be implemented here as needed.
} impl Handler<RaftMetrics> for AppMetrics { type Result = (); fn handle(&mut self, _msg: RaftMetrics, _ctx: &mut Context<Self>) -> Self::Result { // ... snip ... }
} And finally, a simple type alias which ties everything together. This type alias can then be used throughout the application's code base without the need to specify the various types being used for data, errors, network & storage. use actix_raft::Raft; /// A type alias used to define an application's concrete Raft type.
type AppRaft = Raft<Data, DataResponse, Error, AppNetwork, AppStorage>;

