Now that the various needed types are in place, the actix system will need to be started, the various actor types we've defined above will need to be started, and then we're off to the races. use actix;
use actix_raft::{Config, ConfigBuilder, SnapshotPolicy}; fn main() { // Build the actix system. let sys = actix::System::new("my-awesome-app"); // Build the needed runtime config for Raft specifying where // snapshots will be stored. See the storage chapter for more details. let config = Config::build(String::from("/app/snapshots")).validate().unwrap(); // Start off with just a single node in the cluster. Applications // should implement their own discovery system. See the cluster // formation chapter for more details. let members = vec![1]; // Start the various actor types and hold on to their addrs. let network = AppNetwork.start(); let storage = AppStorage.start(); let metrics = AppMetrics.start(); let app_raft = AppRaft::new(1, config, network, storage, metrics).start(); // Run the actix system. Unix signals for termination & // graceful shutdown are automatically handled. let _ = sys.run();
} You've already ascended to the next level of AWESOME! There is a lot more to cover, we're just getting started. Next, let's take a look at the Raft type in more detail.
